e","type":"Plot"},{"attributes":{"data":{"bandwidth":[487217799.1324047,512770715.64942414],"bandwidth_text":["487.22 MB","512.77 MB"],"destination":["1","0"],"source":["0","1"]},"selected":{"id":"1274"},"selection_policy":{"id":"1275"}},"id":"1145","type":"ColumnDataSource"},{"attributes":{},"id":"1079","type":"LinearScale"},{"attributes":{"text":"\n        &lt;h1&gt; Dask Performance Report &lt;/h1&gt;\n\n        &lt;i&gt; Select different tabs on the top for additional information &lt;/i&gt;\n\n        &lt;h2&gt; Duration: 156.96 s &lt;/h2&gt;\n        &lt;h2&gt; Tasks Information &lt;/h2&gt;\n        &lt;ul&gt;\n         &lt;li&gt; number of tasks: 894 &lt;/li&gt;\n         \n&lt;li&gt; compute time: 811.87 s &lt;/li&gt;\n&lt;li&gt; transfer time: 113.74 s &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Scheduler Information &lt;/h2&gt;\n        &lt;ul&gt;\n          &lt;li&gt; Address: tcp://127.0.0.1:38751 &lt;/li&gt;\n          &lt;li&gt; Workers: 2 &lt;/li&gt;\n          &lt;li&gt; Threads: 8 &lt;/li&gt;\n          &lt;li&gt; Memory: 16.64 GB &lt;/li&gt;\n          &lt;li&gt; Dask Version: 2021.01.1 &lt;/li&gt;\n          &lt;li&gt; Dask.Distributed Version: 2021.01.1 &lt;/li&gt;\n        &lt;/ul&gt;\n\n        &lt;h2&gt; Calling Code &lt;/h2&gt;\n        &lt;pre&gt;\ndef run_scene_optimizer() -&gt; None:\n    \"\"\" \"\"\"\n    with initialize_config_module(config_module=\"gtsfm.configs\"):\n        # config is relative to the gtsfm module\n        cfg = compose(config_name=\"default_lund_door_set1_config.yaml\")\n        scene_optimizer: SceneOptimizer = instantiate(cfg.SceneOptimizer)\n\n        loader = OlssonLoader(os.path.join(DATA_ROOT, \"set1_lund_door\"), image_extension=\"JPG\")\n\n        sfm_result_graph = scene_optimizer.create_computation_graph(\n            len(loader),\n            loader.get_valid_pairs(),\n            loader.create_computation_graph_for_images(),\n            loader.create_computation_graph_for_intrinsics(),\n            use_intrinsics_in_verification=True,\n            gt_pose_graph=loader.create_computation_graph_for_poses(),\n        )\n\n        # create dask client\n        cluster = LocalCluster(n_workers=2, threads_per_worker=4)\n\n        with Client(cluster), performance_report(filename=\"dask-report.html\"):\n            sfm_result = sfm_result_graph.compute()\n\n        assert isinstance(sfm_result, GtsfmData)\n\n        # ===== densify =====\n        DENSIFY_RESULTS_PATH = 'results_densify'\n        #   step 1: form image dict\n        img_dict = dict()\n        for i in range(len(loader)):\n            img_dict[i] = loader.get_image(i)\n        #   step 2: call densify\n        mvsnet = MVSNets()\n        dense_points = mvsnet.densify(images=img_dict, sfm_result=sfm_result, save_output=False, output_path=DENSIFY_RESULTS_PATH)\n\n        logger.debug(f\"[Densify] Output dense point cloud volume:{dense_points.shape}\")\n\n        &lt;/pre&gt;\n        "},"id":"1210","type":"Div"},{"attributes":{},"id":"1156","type":"CategoricalScale"},{"attributes":{"high":512770715.64942414,"low":0,"palette":["#ffffFF","#fefeFF","#fdfdFF","#fcfcFF","#fbfbFF","#fafaFF","#f9f9FF","#f8f8FF","#f7f7FF","#f6f6FF","#f5f5FF","#f4f4FF","#f3f3FF","#f2f2FF","#f1f1FF","#f0f0FF","#efefFF","#eeeeFF","#ededFF","#ececFF","#ebebFF","#eaeaFF","#e9e9FF","#e8e8FF","#e7e7FF","#e6e6FF","#e5e5FF","#e4e4FF","#e3e3FF","#e2e2FF","#e1e1FF","#e0e0FF","#dfdfFF","#dedeFF","#ddddFF","#dcdcFF","#dbdbFF","#dadaFF","#d9d9FF","#d8d8FF","#d7d7FF","#d6d6FF","#d5d5FF","#d4d4FF","#d3d3FF","#d2d2FF","#d1d1FF","#d0d0FF","#cfcfFF","#ceceFF","#cdcdFF","#ccccFF","#cbcbFF","#cacaFF","#c9c9FF","#c8c8FF","#c7c7FF","#c6c6FF","#c5c5FF","#c4c4FF","#c3c3FF","#c2c2FF","#c1c1FF","#c0c0FF","#bfbfFF","#bebeFF","#bdbdFF","#bcbcFF","#bbbbFF","#babaFF","#b9b9FF","#b8b8FF","#b7b7FF","#b6b6FF","#b5b5FF","#b4b4FF","#b3b3FF","#b2b2FF","#b1b1FF","#b0b0FF","#afafFF","#aeaeFF","#adadFF","#acacFF","#ababFF","#aaaaFF","#a9a9FF","#a8a8FF","#a7a7FF",
